import React, { useState, useEffect } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import axios from 'axios';

const Sidebar = () => {
    const location = useLocation();
    const navigate = useNavigate();
    const [users, setUsers] = useState([]);
    const userRole = localStorage.getItem('role'); // Admin ya Operator

    useEffect(() => {
        if (userRole === 'admin') {
            axios.get('http://127.0.0.1:8000/api/admin/users')
                 .then(res => setUsers(res.data))
                 .catch(err => console.log("Users list load nahi ho saki"));
        }
    }, [userRole]);

    return (
        <div style={styles.sidebar}>
            <div style={{ textAlign: 'center', marginBottom: '30px' }}>
                <div style={styles.avatar}>üõ°Ô∏è</div>
                <h3 style={{ color: '#38bdf8', marginTop: '10px' }}>DeepGuard</h3>
            </div>

            {/* Menu Sections */}
            <div style={styles.sectionLabel}>CORE WORKSPACE</div>
            <Link to="/dashboard" style={styles.navLink(location.pathname === '/dashboard')}>üìä Dashboard</Link>
            <Link to="/history" style={styles.navLink(location.pathname === '/history')}>üìú Forensic History</Link>

            {/* --- ADMIN ONLY: USER MANAGEMENT --- */}
            {userRole === 'admin' && (
                <div style={{ marginTop: '30px' }}>
                    <div style={styles.sectionLabel}>IDENTITY MANAGEMENT</div>
                    <Link to="/admin-panel" style={styles.adminActionBtn}>‚ûï Assign New Member</Link>
                    
                    <div style={styles.userListScroll}>
                        {users.map(u => (
                            <div key={u.user_id} style={styles.userBadge}>
                                <div style={styles.dot(u.role)}></div>
                                <div style={{display: 'flex', flexDirection: 'column'}}>
                                    <span style={{fontSize: '12px', color: 'white'}}>{u.full_name}</span>
                                    <span style={{fontSize: '9px', color: '#94a3b8'}}>{u.role.toUpperCase()}</span>
                                </div>
                            </div>
                        ))}
                    </div>
                </div>
            )}

            <button onClick={() => { localStorage.clear(); navigate('/'); }} style={styles.logoutBtn}>üö™ Exit System</button>
        </div>
    );
};

const styles = {
    sidebar: { width: '260px', backgroundColor: '#0f172a', height: '100vh', padding: '20px', borderRight: '1px solid #1e293b', display: 'flex', flexDirection: 'column' },
    avatar: { width: '60px', height: '60px', backgroundColor: '#1e293b', borderRadius: '50%', display: 'flex', justifyContent: 'center', alignItems: 'center', margin: '0 auto', fontSize: '30px', border: '2px solid #38bdf8' },
    sectionLabel: { fontSize: '10px', color: '#475569', letterSpacing: '1px', marginBottom: '15px' },
    navLink: (active) => ({ display: 'block', padding: '12px', color: active ? '#38bdf8' : '#94a3b8', textDecoration: 'none', backgroundColor: active ? '#1e293b' : 'transparent', borderRadius: '8px', marginBottom: '5px' }),
    adminActionBtn: { display: 'block', textAlign: 'center', padding: '10px', backgroundColor: '#38bdf8', color: '#0f172a', textDecoration: 'none', borderRadius: '8px', fontWeight: 'bold', fontSize: '12px', marginBottom: '15px' },
    userListScroll: { maxHeight: '200px', overflowY: 'auto', marginTop: '10px' },
    userBadge: { display: 'flex', alignItems: 'center', gap: '10px', padding: '8px', backgroundColor: '#1e293b55', borderRadius: '8px', marginBottom: '5px' },
    dot: (role) => ({ width: '8px', height: '8px', borderRadius: '50%', backgroundColor: role === 'admin' ? '#f59e0b' : '#38bdf8' }),
    logoutBtn: { marginTop: 'auto', padding: '10px', border: '1px solid #ef4444', backgroundColor: 'transparent', color: '#ef4444', borderRadius: '8px', cursor: 'pointer' }
};

export default Sidebar;
